import React from 'react'
import SectionOne from './SectionsMainHome/SectionOne'
import SectionTwo from './SectionsMainHome/SectionTwo'

const HomeMain = () => {

  const proyectos = [
    {tipo: "Proyectos"},
    {proyecto: "Pokedex Henry", descripcion: "Construir una App utilizando React, Redux, Node y Sequelize"}, {proyecto: "TICKETSHOP Henry", descripcion: "Construir una App con autenticación propia y de terceros, borrado lógico, notificiaciones e-mail, filtros combinados y más..."}, {proyecto: "Responsive Design Product", descripcion: "Construir y maquetar una página estática de forma responsiva para entender el funcionamiento de los breakpoints"}
  ]

  const cursos = [
    {tipo: "Proyecots"}, {curso: "Curso Práctico de Maquetación en CSS", descripcion: "Crear un espacio personal para reforzar conocimientos en maquetación de HTML5 semántico, maquetando el header, el main y el footer, creando estilos para el proyecto de forma estética", link: "https://postimg.cc/dLXMTr4T"}, {curso: "Responsive Design: Maquetación Mobile First", descripcion: "Aprender a crear prouectos que se adaptarán a las distintas vistas que utilicen los usuarios, se analizó la arquitectura de un proyecto partiendo de un wireframe, se hizo la auditoria del sitio con Lighthouse"}
  ]



  return (
    <main className='blogs-main'>
        <SectionOne />
        <SectionTwo  data={proyectos}/>
        <SectionTwo tipo={cursos} />
    </main>
  )
}

export default HomeMain
